CREATE PROCEDURE [dbo].[ClienteEliminar]
	@IdCliente INT

AS

 BEGIN
SET NOCOUNT ON

    BEGIN TRANSACTION TRASA 

	  BEGIN TRY
	    INSERT INTO Cliente
		(
	        Identificacion,
            IdTipoIdentificacion,
            Nombre,
            PrimerApellido,
            SegundoApellido,
            FechaNacimiento,
            Nacionalidad,
            FechaDefuncion,
            Genero,
            NombreApellidosPadre,
            NombreApellidosMadre,
            Pasaporte,
            CuentaIBAN,
            CorreoNotifica 
		)
		VALUES
		(
            @Identificacion,
            @IdTipoIdentificacion,
            @Nombre,
            @PrimerApellido,
            @SegundoApellido,
            @FechaNacimiento,
            @Nacionalidad,
            @FechaDefuncion,
            @Genero,
            @NombreApellidosPadre,
            @NombreApellidosMadre,
            @Pasaporte,
            @CuentaIBAN,
            @CorreoNotifica 
		)
		COMMIT TRANSACTION TRASA
		SELECT 0 AS CodeError, '' AS MsgError

	  END TRY 

	  BEGIN CATCH

	   SELECT 
	         ERROR_NUMBER() AS CodeError,
			 ERROR_MESSAGE() AS MsgError
		 ROLLBACK TRANSACTION TRASA

	  END CATCH

    END

